/* eslint-disable no-unused-vars */
import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

import './App.css';

const App = () =>

  <Router>
    <>
      <Switch>
          <Route path="/">
            <>
              <Home />
            </>
          </Route>

          <Route path="/about">
            <>
              <About />
            </>
          </Route>

          <Route path="/users">
            <>
            <About />
            </>
          </Route>
      </Switch>
    </>
  </Router>

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
